/**Contest82. 3-medium
 * 826. 基于最高利润分配工作
 * jobs: difficulty[i]表示工作难度，profit[i]表示工作利润
 * workers: worker[i]表示工人的能力，最多只能完成难度小于等于其能力工作
 * 每个工人最多只能分配一个工作，每个工作可以完成多次
 * 如，三工人分配完成同一个1$的工作，总利润就是3$. 如果一个工人完不成，利润就是0$
 * 输出最大利润。
 * Input: difficulty = [2,4,6,8,10], profit = [10,20,30,40,50], worker = [4,5,6,7]
 * Output: 100
 * Explanation: Workers are assigned jobs of difficulty [4,4,6,6] and they get profit of [20,20,30,30] seperately.*/
//1 <= difficulty.length = profit.length <= 10000
//1 <= worker.length <= 10000
//difficulty[i], profit[i], worker[i]  are in range [1, 10^5]

//[2,4,6,8,10]
//[10,20,30,40,50]
//[4,5,6,7]

//[85,47,57]
//[24,66,99]
//[40,25,25]

//[13,37,58]
//[4,90,96]
//[34,73,45]


//利润和难度一定成正比么？ -> No
public class MostProfitAssigningWork {
    @Deprecated
    public int maxProfitAssignment1(int[] difficulty, int[] profit, int[] worker) {
        Arrays.sort(worker);
        int index = 0, total = 0;
        for (int work : worker) {
            while (index < difficulty.length) {
                if (difficulty[index] <= work) {
                    index++;
                    continue;
                }
                break;
            }
            if (index > 0)
                total += profit[index - 1];
        }

        return total;
    }

    /**O(N2) Time Limit Exceeded*/
    public int maxProfitAssignment2(int[] difficulty, int[] profit, int[] worker) {
        int total = 0;
        for (int work : worker) {
            int max = 0;
            for (int i = 0; i < difficulty.length; i++){
                if (difficulty[i] <= work)
                    max = Math.max(max, profit[i]);
            }
            total += max;
        }

        return total;
    }

    /**O(nlogn)*/
    public int maxProfitAssignment(int[] difficulty, int[] profit, int[] worker) {
        List<Pair<Integer, Integer>> jobs = new ArrayList<>();
        int N = profit.length, total = 0, i = 0, maxpro = 0;
        for (int k = 0; k < N; k++)
            jobs.add(new Pair<>(difficulty[k], profit[k]));
        jobs.sort(Comparator.comparing(Pair::getKey)); //sort by difficulty
        Arrays.sort(worker);
        for (int ability : worker) {
            while (i < N && ability >= jobs.get(i).getKey())
                maxpro = Math.max(jobs.get(i++).getValue(), maxpro); //update max profit
            total += maxpro;
        }

        return total;
    }
}


